function rplg_load_imgs(el){var imgs=el.querySelectorAll('img.rplg-blazy[data-src]');for(var i=0;i<imgs.length;i++){imgs[i].setAttribute('src',imgs[i].getAttribute('data-src'));imgs[i].removeAttribute('data-src');}}
